import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Competition() {
  const [selectedGroups, setSelectedGroups] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/api/selectedGroups')
      .then((response) => {
        setSelectedGroups(response.data); // Store the data in state
      })
      .catch((error) => {
        console.error('Error fetching selected groups:', error);
      });
  }, []);

  return (
    <div>
      <h1>Competition</h1>
      <div>
        <h2>Selected Groups</h2>
        <ul>
          {selectedGroups.map((group) => (
            <li key={group.joukkue_id}>{group.joukkue_nimi}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default Competition;
